static unsigned long count_high_zeroes32(Uint32 value) {
	Uint8 count = 0;
	if (!(value >> 16)) {count += 16; value <<= 16;}
	if (!(value >> 24)) {count += 8; value <<= 8;}
	return count_high_zeroes_table[value >> 24] + count;
}
